create table <?= DB_SCHEMA ?>.geo_locations (
	_id int not null auto_increment comment 'Identificador',
	_district int not null comment 'Distrito administrativo',
	_name Varchar(64) null comment 'Nombre',
	_officialname Varchar(64) null comment 'Nombre oficial',
	_fullname Varchar(64) not null comment 'Nombre compuesto',
	_place Varchar(64) null comment 'Parte',
	_code Varchar(64) null comment 'Parte distrital',
	_note Varchar(256) null comment 'Nota',
	_zone int not null comment 'Urbanidad',
	_typology int not null comment 'Tipologia',
	_region int not null comment 'Región',
	_description Varchar(512) null comment 'Localización',
	_latitude Decimal(10, 8) not null comment 'Latitud',
	_longitude Decimal(10, 8) not null comment 'Longitud',
	_law Varchar(64) null comment 'Decreto o ley',
	_segregated Varchar(64) null comment 'Segregado',
	_date Date null comment 'Fecha',
	primary key (_id),
	unique key uk_locations_latitude_longitude (_latitude, _longitude),
	foreign key (_district) references <?= DB_SCHEMA ?>.geo_districts(_id),
	foreign key (_zone) references <?= DB_SCHEMA ?>.geo_zones(_id),
	foreign key (_typology) references <?= DB_SCHEMA ?>.geo_typologies(_id),
	foreign key (_region) references <?= DB_SCHEMA ?>.geo_regions(_id)
)
engine = InnoDB
comment = 'Localidades';






































